import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import * as r from "../style/styledreview";

const Review = () => {
  const navigate = useNavigate();
  const [box2Items, setBox2Items] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const goMain = () => {
    navigate(`/`);
  };

  const goReviewcheck1 = () => {
    navigate(`/Reviewcheck1`);
  };

  useEffect(() => {
    const fetchRecommendedProducts = async () => {
      try {
        const token = localStorage.getItem('token'); // localStorage에서 토큰 가져오기
        if (!token) {
          throw new Error("No token found");
        }

        const config = {
          headers: {
            'Authorization': `Token ${token}` // DRF에서 토큰 인증시 'Token ' 접두어가 필요할 수 있음
          }
        };

        const response = await axios.get('http://127.0.0.1:8000/myPage/recommended-products/', config);
        const products = response.data.map(product => ({
          id: product.recommendedProduct_id,
          name: product.product.name // product 객체의 name 필드 사용
        }));
        setBox2Items(products);
        setLoading(false);
      } catch (err) {
        if (err.message === "No token found") {
          alert("토큰이 없습니다. 로그인이 필요합니다.");
          navigate("/login");
        } else if (err.response && err.response.status === 401) {
          console.error("Authentication error: Unauthorized");
          setError(new Error("인증 오류: 로그인이 필요합니다."));
        } else {
          console.error("An error occurred:", err.message);
          setError(err);
        }
        setLoading(false);
      }
    };

    fetchRecommendedProducts();
  }, [navigate]);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error.message}</div>;
  }

  return (
    <r.Container>
      <r.Header>
        <img
          id="back"
          src={`${process.env.PUBLIC_URL}/logo/backbtn.svg`}
          alt="back button"
          style={{
            position: "absolute",
            top: "8px",
            left: "8px",
            cursor: "pointer",
          }}
          onClick={() => navigate(-1)}
        />
        <img
          id="logo"
          src={`${process.env.PUBLIC_URL}/logo/ylogo.svg`}
          alt="logo"
          width="40px"
          onClick={goMain}
        />
        <img
          id="alarm"
          src={`${process.env.PUBLIC_URL}/logo/alarm.svg`}
          alt="alarm button"
          style={{
            position: "absolute",
            top: "8px",
            left: "8px",
            cursor: "pointer",
          }}
          onClick={() => navigate(-1)}
        />
        <img
          id="menu"
          src={`${process.env.PUBLIC_URL}/logo/menu.svg`}
          alt="menu button"
          style={{
            position: "absolute",
            top: "8px",
            left: "8px",
            cursor: "pointer",
          }}
          onClick={() => navigate(-1)}
        />
        <r.Border>
          <div></div>
        </r.Border>
      </r.Header>

      <r.Top>리뷰 작성하기</r.Top>

      <r.Body>
        <r.Box>
          <r.Kit>후기를 작성할 제품을 선택해 주세요.</r.Kit>
          <r.Box2>
            {box2Items.map((item) => (
              <r.Keywordd key={item.id}>
                <r.SmallBox5>
                  <span>{item.name}</span>
                </r.SmallBox5>
              </r.Keywordd>
            ))}
          </r.Box2>
        </r.Box>

        <r.Under>
          김세모님! <br />
          [제품명]은 어떠셨어요?
        </r.Under>

        <r.Button2>
          <img
            id="ylogo"
            src={`${process.env.PUBLIC_URL}/logo/good.svg`}
            alt="logo"
            width="65px"
          />
          <img
            id="ylogo"
            src={`${process.env.PUBLIC_URL}/logo/bad.svg`}
            alt="logo"
            width="65px"
          />
        </r.Button2>

        <r.InputBlank>
          <input type="text" placeholder="텍스트 리뷰를 작성해 주세요." />
        </r.InputBlank>

        <r.Button onClick={goReviewcheck1}>
          <r.ButtonText>저장하기</r.ButtonText>
        </r.Button>
      </r.Body>
    </r.Container>
  );
};

export default Review;
